/*Table structure for table `pedido` */

DROP TABLE IF EXISTS `pedido`;

CREATE TABLE `pedido` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `estado` varchar(45) DEFAULT NULL,
  `envio` int(1) NOT NULL DEFAULT '0',
  `cliente_id` int(11) NOT NULL,
  `fecha_pedido` date DEFAULT NULL,
  `cobrado` int(1) NOT NULL DEFAULT '0',
  `precio_envio` double NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `cadete_id` int(11) DEFAULT NULL,
  `observaciones` varchar(45) DEFAULT NULL,
  `pedido_empresa_id` int(11) DEFAULT NULL,
  `total` decimal(10,0) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_pedido_cliente1_idx` (`cliente_id`),
  KEY `fk_pedido_cadete` (`cadete_id`),
  CONSTRAINT `fk_pedido_cadete` FOREIGN KEY (`cadete_id`) REFERENCES `cadete` (`id`),
  CONSTRAINT `fk_pedido_cliente1` FOREIGN KEY (`cliente_id`) REFERENCES `cliente` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=729 DEFAULT CHARSET=latin1;

