  `total` decimal(10,0) NOT NULL DEFAULT '0',
  `cadete_id` int(11) DEFAULT NULL,
  `precio_envio` decimal(10,0) DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `FK_pedido_empresa` (`cadete_id`),
  KEY `FK_pedido_empresa_empresa` (`empresa_id`),
  CONSTRAINT `FK_pedido_empresa` FOREIGN KEY (`cadete_id`) REFERENCES `cadete` (`id`),
  CONSTRAINT `FK_pedido_empresa_empresa` FOREIGN KEY (`empresa_id`) REFERENCES `empresa` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

